import { Router } from "@material-ui/icons";
import { useState } from "react";
import "./App.css";
import Footer from "./Components/Footer";
import Navbar from "./Components/Navbar";
function App() {
  const [light, SetLight] = useState(false);
  console.log(light);
  return (
    <div className="App">
      <Router>
        <header className="App-header">
          <Navbar SetLight={SetLight} light={light} />
          <div className="image">
            <img src="./img/lamp.png" className="lamp" />
            <img
              src="./img/light.png"
              className={light ? "light_on" : "light"}
            />
          </div>
          <div className="text">
            <h2>Super NFT Market</h2>
            <div className="text_test">
              <p>
                Transactions through our market increase users' assets than
                before.
              </p>
              <span>Increase your assets through various NFT transactions</span>
            </div>
          </div>
        </header>
      </Router>

      <Footer />
    </div>
  );
}

export default App;
